import React from "react";
import Background from "./componets/Background";
import SearchIcon from "./componets/UI/SearchLong/SearchIcon";
import SearchLongInput from "./componets/UI/SearchLong/SearchLongInput";

function MainDishes(){
    return(
        <div>
            <Background/>
            <SearchIcon>
                <SearchLongInput/>
            </SearchIcon>
        </div>
    )
}
